import React, {Suspense, useEffect,useState} from 'react';
import {BlockHeader} from '../globalComponents/blockHeader.jsx';
import { globalInfo } from '../global_Info.js';
import './usageLog.css';
import '../index.css'

function UsageLog() {

    var state = {
        title: 'API Usage Log'
    }

    // const [refreshState,setRefreshSate] = useState(false);
    // const [usageLogSrc,updateSrc] = useState(globalInfo.usageLogSrc);
    const [count,RerenderThis] = useState(1);

    useEffect(() => { 
        // if(refreshState){
        //     globalInfo.usageLogSrc = globalInfo.usageLogSrc;
        // }
        console.log('usagelog has been mounted to color ' + '<pre>usageLogSrc</pre>')
        var iframe = document.querySelector('iframe');
        globalInfo.usageLogSrc = globalInfo.usageLogSrc
        setTimeout( () => iframe.setAttribute('src',globalInfo.usageLogSrc) );
    });
  
    return (
    <>
        <div className="usagelog ui outer container p-20">

            <BlockHeader title={state.title}/>
            
            <div className='log-wrap'>
                <div className="usagelog refresh btn" 
                onClick={() => RerenderThis(count += 1)}>
                </div>
                <iframe>
                </iframe>
            </div>
        </div>
    </>
    );
  }

  export {UsageLog}

